targets.expr:
(
  volume_total_ops{datacenter=~"$Datacenter", cluster=~"$Cluster", svm=~"$SVM", volume=~"$Volume"}
  /
  clamp_min(
    volume_space_logical_used{datacenter=~"$Datacenter", cluster=~"$Cluster", svm=~"$SVM", volume=~"$Volume"} / 1099511627776,
    1
  )
)
and
topk(
  $TopResources,
  (
    avg_over_time(
      volume_total_ops{datacenter=~"$Datacenter", cluster=~"$Cluster", svm=~"$SVM", volume=~"$Volume"}[$__range] @ end()
    )
    /
    clamp_min(
      avg_over_time(
        volume_space_logical_used{datacenter=~"$Datacenter", cluster=~"$Cluster", svm=~"$SVM", volume=~"$Volume"}[$__range] @ end()
      ) / 1099511627776,
      1
    )
  )
  unless
  on(datacenter, cluster, svm, volume)
  volume_labels{datacenter=~"$Datacenter", cluster=~"$Cluster", svm=~"$SVM", volume=~"$Volume", root_volume="Yes"}
)

bottomk(
  $TopResources,
  (
    avg_over_time(
      volume_total_ops{datacenter=~"$Datacenter", cluster=~"$Cluster", svm=~"$SVM", volume=~"$Volume"}[$__range] @ end()
    )
    /
    clamp_min(
      avg_over_time(
        volume_space_logical_used{datacenter=~"$Datacenter", cluster=~"$Cluster", svm=~"$SVM", volume=~"$Volume"}[$__range] @ end()
      ) / 1099511627776,
      1
    )
  )
  unless
  on(datacenter, cluster, svm, volume)
  (
    volume_labels{datacenter=~"$Datacenter", cluster=~"$Cluster", svm=~"$SVM", volume=~"$Volume", root_volume="Yes"}
    or
    avg_over_time(
      volume_total_ops{datacenter=~"$Datacenter", cluster=~"$Cluster", svm=~"$SVM", volume=~"$Volume"}[$__range] @ end()
    ) == 0
  )
)
